    false,nt"url": null,nt"notes": "TerraPoint surveyed and created this data
    for the Puget Sound LiDAR Consortium under contract. The area surveyed is approximately
    730 square miles and covers the lowlands for Mason County. It also includes the
    Chehalis River in Grays Harbor County and a section of the Dugeness River in Clallam
    County. All data was collected during ideal conditions (leaf-off). The LAS files
    were derived from all returns ASCII files that contain the X,Y,Z values of all the
    LiDAR returns collected during the survey mission. The GPS time, scan angle and
    return numbers of each point were preserved in the conversion from ASCII to LAS.
    The total number of returns for each pulse was not available, a value of 4 was assigned
    to each point. Futher details are available in the Process Steps below. No ancillary
    data, such as intensity, is available for this data. Initially this dataset was
    flown in 2002 with a 50% overlap between flight lines. Due to the overlap the nominal
    point spacing of the dataset is 1.0 meter. Both bare-earth and the original all-return
    ASCII files are available at pugetsoundlidar.org.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
